'               var i;',
'               var fpath;',
'               var prefix = subdirpath.slice(pathprefix.length);',
'               for (i=0; i<files.length; i++) {',
'                  fpath = prefix+files[i];',
'                  filelist.push(fpath);',
'               }',
'               var dirs = listingObj.dirs;',
'               if (dirs.length==0) {',
'                  if (pending==0) {',
'                     onCompletion(filelist);',
'                  }',
'                  return;',
