'                           }',
'                           else {',
'                              listingObj.dirs.push(entry);',
'                           }',
'                        }',
'                        readDirEntries(); // recurse to call dirReader.readEntries again',
'                     },',
'                     onError);',
'                  };',
'               readDirEntries(); // do first reading of entries',
'            };',
